import React, {Component} from 'react'
import { green } from 'ansi-colors'
import './App.css'
import Navbar from './Nav.js'

class App extends Component{
    constructor(props){
        super(props)
        this.state = {
            account: '0x2'
        }
    }
    render(){
        return(
            <div>
                <Navbar account={this.state.account}/>
                <div className="text-center" >
                    <h></h>
                </div>
            </div>
        )
    }
}

export default App;
